import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import '@coreui/coreui';
import App from './App';
import * as serviceWorker from './serviceWorker';
import {render} from 'react-dom';

render(
    <App/>,
    document.getElementById('root')
);
